webpackJsonp([0x8c2dee9b5763],{8203:function(e,t){e.exports={data:{post:{html:"<p>(Note: the name of the series has been updated to more accurately reflect the spirit in which it's intended.)</p>\n<p><strong>I don't miss American food.</strong> It seems every expat blogger goes through a phase where they're missing some type of food from home, usually something heavily processed and extremely unhealthy. Comfort food. Some expats never snap out of it.</p>\n<p>Maybe it's because our business is food (my wife says to add that you're all welcome to buy all the comfort food you want from us!), or because I learned economics and understand supply and demand, but I was never all that emotionally attached to food from home. If there's something you miss, learn to make it (or a close approximation) yourself.</p>\n<p>And you can find peanut butter and Oreos at pretty much any German supermarket these days.</p>\n<p>(part of a <a href=\"http://www.papascott.de/archives/category/not-an-expat-blogger/\">series</a>)</p>",fields:{title:"I am not an Expat Blogger 7: Food",date:"27 Jul 2012",url:"https://papascott.de/2012-07-27-i-am-not-an-expat-blogger-7-food/"}}},pathContext:{slug:"/2012-07-27-i-am-not-an-expat-blogger-7-food/",prev:{fields:{title:"I am not an Expat Blogger 6: Beer",date:"25 Jul 2012",slug:"/2012-07-25-i-am-not-an-expat-6-beer/"}},next:{fields:{title:"I am not an Expat Blogger 8: Sexual Orientation",date:"27 Jul 2012",slug:"/2012-07-27-i-am-not-an-expat-blogger-8-sexual-orientation/"}}}}}});
